import React from 'react';
import './Scroll.css';
import { Animator, batch, FadeOut, ScrollContainer, ScrollPage, ZoomOut,ZoomIn } from 'react-scroll-motion';
import page1 from '../img/paper1.jpeg';
import page2 from '../img/paper2.png';
import page3 from '../img/paper3.png';

const ZoomInScrollOut= batch(FadeOut(),ZoomOut());

function Scroll() {
    return ( 
      <ScrollContainer>
        <ScrollPage page={0}> 
        <Animator animation= { batch(ZoomIn(2 ,10))}>

            <img src={page1}  alt="scrollimage1" />

        </Animator>
        </ScrollPage>

        <ScrollPage page={1}> 
        <Animator animation= { batch(ZoomOut(0 , -200))}>

            <img src={page2}  alt="scrollimage2" />

        </Animator>
        </ScrollPage>
      </ScrollContainer>
     );
}

export default Scroll;
